  return (
    <div className="main">
      <h1 className="main-h1">Star Wars fanpage</h1>

      <p className="">Please verify your age: </p>

      <a href="#">I declare, that I am 16 years or older</a>
      <a href="#">I am under 16 years of age</a>
    </div>
  );
}

export default HomePage;
